import Book from '../Components/Book'
import data from '../../src/data'

const allBooks = data.map( d => {

  if(d.category.includes("category1")){
    return (
      <Book 
        key={d._id}
        book={d}
      />
    )
  } else {
    console.log("nothing")
  }

  // return (
  //   <Book 
  //     key={d._id}
  //     book={d}
  //   />
  // )
})

const Books = () => {
  return (
    <div className="books">
      {allBooks}
    </div>
  )
}

export default Books
